const ExpenseList=(props)=>{
    let expenseFilter=<p>No Expenses Found</p>
    return <ul> (
        
        props.filteredList.map((expenses) => (
            <ExpenseComponent
              key={expenses.id}
              title={expenses.title}
              amount={expenses.amount}
              date={expenses.date}
            />
     
        )
      )
      
    )
    </ul>
}

export default ExpenseList
